import React from 'react';

export default function ViewBtn() {
    return (
        <div className='row no-gutters'>
            <div className='col'>
                <div className='viewbtn'>
                    <a href='#' style={{ paddingBottom: '0' }} className='btn'>
                        View All
                    </a>
                </div>
            </div>
        </div>
    )
}
